import React, { useEffect } from "react";
import { Radar } from "react-chartjs-2";
import {
  Chart as ChartJS,
  RadialLinearScale,
  PointElement,
  LineElement,
  Filler,
  Tooltip,
  Legend
} from "chart.js";
import { useNavigate, useLocation } from "react-router-dom";

ChartJS.register(RadialLinearScale, PointElement, LineElement, Filler, Tooltip, Legend);

function ResultPage() {
  const location = useLocation();
  const navigate = useNavigate();

  const { results, importance, commitment, name = "ÏÇ¨Ïö©Ïûê" } = location.state || {};
  const topValues = results?.feedback1?.slice(0, 2) || [];

  // ‚ùó useEffectÏóêÏÑú navigate Ïã§Ìñâ
  useEffect(() => {
    if (!results || !importance || !commitment) {
      navigate("/survey");
    }
  }, [results, importance, commitment, navigate]);

  // ‚ùó fallback Î†åÎçîÎßÅ
  if (!results || !importance || !commitment) {
    return null;
  }

  const labels = [
    "Í∞ÄÏ°±", "Î∂ÄÎ∂ÄÍ¥ÄÍ≥Ñ", "Î∂ÄÎ™®Îê®", "ÏπúÍµ¨Í¥ÄÍ≥Ñ",
    "Ïùº", "ÍµêÏú°", "Ï¶êÍ±∞ÏõÄ", "ÏòÅÏÑ±", "ÏÇ¨ÌöåÏ∞∏Ïó¨", "Ïã†Ï≤¥Í¥ÄÎ¶¨", "ÌôòÍ≤Ω", "Ï∞ΩÏ°∞ÏÑ±"
  ];

  const chartData = {
    labels,
    datasets: [
      {
        label: "Í∞ÄÏπò",
        data: importance,
        backgroundColor: "rgba(255,99,132,0.2)",
        borderColor: "rgba(255,99,132,1)",
        borderWidth: 1,
      },
      {
        label: "Ïã§Ï≤ú",
        data: commitment,
        backgroundColor: "rgba(54, 162, 235, 0.2)",
        borderColor: "rgba(54, 162, 235, 1)",
        borderWidth: 1,
      }
    ]
  };

  const chartOptions = {
    scales: {
      r: {
        min: 0,
        max: 10,
        ticks: { stepSize: 1 },
        pointLabels: { font: { size: 12 } }
      }
    },
    plugins: {
      legend: { display: false }
    }
  };

  const topValue = topValues[0] || "ÏóÜÏäµÎãàÎã§";
  const lowCommit = results.feedback2.length > 0 ? results.feedback2[0] : "ÏóÜÏäµÎãàÎã§";

  const goToJournal = () => {
    navigate("/journal", {
      state: {
        name,
        topValues
      }
    });
  };

  const goBack = () => {
    navigate(-1); // üëà Ïù¥Ï†Ñ ÌéòÏù¥ÏßÄÎ°ú ÎèåÏïÑÍ∞ê
  };

  return (
    <div style={{ maxWidth: "500px", margin: "0 auto", padding: "2rem", fontFamily: "sans-serif" }}>
      <h2 style={{ textAlign: "center", marginBottom: "1.5rem" }}>ÎÇ¥ ÏÇ∂Ïùò Î∞©Ìñ• Ï∞æÍ∏∞</h2>

      <div style={{ backgroundColor: "#000", color: "#fff", padding: "1rem", textAlign: "center", borderRadius: "8px", marginBottom: "1.5rem" }}>
        <strong>ÎÇòÏùò Í∞ÄÏπòÎ°úÏö¥ ÏÇ∂ Í≤∞Í≥º</strong>
      </div>

      <Radar data={chartData} options={chartOptions} />

      <div style={{
        backgroundColor: "#fafafa",
        padding: "1.5rem",
        marginTop: "2rem",
        borderRadius: "12px",
        textAlign: "center",
        boxShadow: "0 0 10px rgba(0,0,0,0.05)"
      }}>
        <h3 style={{ margin: "0 0 0.8rem", fontWeight: "600", fontSize: "1.1rem" }}>ÎÇ¥ Í∞ÄÏπòÎ°úÏö¥ ÏÇ∂ Ï†êÏàò</h3>
        <div style={{ fontSize: "2.5rem", fontWeight: "700", margin: "0.5rem 0 1rem" }}>{results.score.toFixed(1)}</div>

        <p style={{ fontSize: "1rem", marginBottom: "1rem" }}>
          ÎãπÏã†ÏóêÍ≤å Ï§ëÏöîÌïú Í∞ÄÏπòÎäî <strong style={{ color: "#a678ff" }}>{topValue}</strong>ÏûÖÎãàÎã§.
        </p>
        <p style={{ fontSize: "1rem", color: "#333" }}>
          Ï§ëÏöîÌïòÏßÄÎßå Ïûò Ïã§Ï≤úÌïòÏßÄ Î™ªÌïòÎäî Í∞ÄÏπòÎäî <strong style={{ color: "#a678ff" }}>{lowCommit}</strong>ÏûÖÎãàÎã§. <br />
          {lowCommit === "ÏóÜÏäµÎãàÎã§" ? "Î™®Îëê Ïûò Ïã§Ï≤úÌïòÍ≥† ÏûàÎäî Ìé∏Ïù¥ÎÑ§Ïöî." : ""}
        </p>
      </div>

      <div style={{ display: "flex", justifyContent: "space-between", marginTop: "3rem" }}>
        <button
          onClick={goBack}
          style={{
            backgroundColor: "#fff",
            color: "#000",
            padding: "0.7rem 2rem",
            borderRadius: "8px",
            fontSize: "1rem",
            border: "1px solid #000"
          }}
        >
          Ïù¥Ï†Ñ
        </button>

        <button
          onClick={goToJournal}
          style={{
            backgroundColor: "#000",
            color: "#fff",
            padding: "0.7rem 2rem",
            borderRadius: "8px",
            fontSize: "1rem"
          }}
        >
          Îã§Ïùå
        </button>
      </div>
    </div>
  );
}

export default ResultPage;
